Lets start with the LED service. The goal of this service is to allow other applications to use the shared buffer as a command message to instruct the LED service on how to turn on or off the system's LEDs. We must tell the kernel that our app wishes to provide a service. All that we have to do is call ipc_register_svc(). #include "ipc.h" int main(void) { ipc_register_svc(ipc_callback, NULL); return 0;
} We also need that callback (ipc_callback) to handle IPC requests from other applications. This callback will be called when the client app notifies the service. static void ipc_callback(int pid, int len, int buf, void* ud) { // pid: An identifier for the app that notified us. // len: How long the buffer is that the client shared with us. // buf: Pointer to the shared buffer.
} Now lets fill in the callback for the LED application. This is a simplified version for illustration. The full example can be found in the examples/tutorials folder. #include "led.h" static void ipc_callback(int pid, int len, int buf, void* ud) { uint8_t* buffer = (uint8_t*) buf; // First byte is the command, second byte is the LED index to set, // and the third byte is whether the LED should be on or off. uint8_t command = buffer[0]; if (command == 1) { uint8_t led_id = buffer[1]; uint8_t led_state = buffer[2] > 0; if (led_state == 0) { led_off(led_id); } else { led_on(led_id); } // Tell the client that we have finished setting the specified LED. ipc_notify_client(pid); break; }
}

